pragma solidity ^0.4.13;


library DoublyLinkedList {
    struct Elements {
        bytes32 head;
        bytes32 tail;
        uint256 size;
        mapping(bytes32 => Element) elements;
    }

    struct Element {
        bytes32 previous;
        bytes32 next;
        bool data;
    }

    function getNext(Elements storage self, bytes32 key) public view returns (bytes32) {
        return self.elements[key].next;
    }

    function getElement(Elements storage self, bytes32 key) public view returns (bool) {
        return self.elements[key].data;
    }

    function addElement(Elements storage self, bytes32 key) public returns (bool success) {
        Element storage elem = self.elements[key];
        if (elem.data) {
            revert();
        }

        if (self.size == 0) {
            self.head = key;
            self.tail = key;
        } else {
            self.elements[self.head].next = key;
            elem.previous = self.head;
            self.head = key;
        }
        elem.data = true;
        self.size++;
        return true;
    }

    function removeElement(Elements storage self, bytes32 key) public returns (bool success) {
        Element storage elem = self.elements[key];
        require(elem.data);
        require(self.size > 0);

        if (self.size == 1) {
            self.head = bytes32(0);
            self.tail = bytes32(0);
        } else if (key == self.head) {
            self.head = elem.previous;
        } else if (key == self.tail) {
            self.tail = elem.next;
        } else {
            self.elements[elem.previous].next = elem.next;
            self.elements[elem.next].previous = elem.previous;
        }
        delete elem.data;
        delete elem.previous;
        delete elem.next;
        self.size--;
        return true;
    }
}
